    },
    {
      taskId:"123",
      taskName:"Go to Park"
    }
    ]
  }
]

const todoList = (data) => {
  let h = [];
  data.map((item,index)=>{
    h.push(
      <tr key={index}>
        <td><input type="checkbox"/></td>
      <td>{item.taskName}</td>
    </tr>
    )
  })
  return h;
}
const bucketList = () => {
  let h= [];
   bucketListData.map((item,index)=>{
        h.push(<div className="col-sm-4 col-md-4 col-xs-12"><table key={index} className="table">
          <thead className="thead-dark">
            <tr>
              <th scope="col"> {item.title}</th>
            </tr>
          </thead>
            <tbody>
            {todoList(item.data)}
            </tbody>
        </table>
        </div>
        )
      })
      return h; 
}
function App() {
  return (
    <div className="container">
      <h1>ToDo List Buckets</h1>
      {bucketList(bucketListData)}
    </div>
  );
}

export default App;
